class Solution:
    def twoSumLessThanK(self, A: List[int], K: int) -> int:
        filtered = []
        for em in A:
            if em < K:
                filtered.append(em)
        if len(filtered) < 2:
            return -1
        i = 0
        j = len(filtered) - 1
        s = 0
        filtered.sort()
        while i < j:
            now = filtered[i] + filtered[j]
            if now >= K:
                j -= 1
                continue
            if now > s:
                s = now
            i += 1

        return s

    def numKLenSubstrNoRepeats(self, S: str, K: int) -> int:
        d = [1] * len(S)
        d_map = {}
        for char in S:
            if not d_map.__contains__(char):
                d_map[char] = -1
        flag = -1
        for i in range(len(S)):
            d[i] = min(i - d_map[S[i]], i - flag)
            if d[i] <= d[i - 1]:
                flag = d_map[S[i]]
            d_map[S[i]] = i
        cnt = 0
        for dd in d:
            if dd >= K:
                cnt += 1
        return cnt

    def earliestAcq(self, logs: List[List[int]], N: int) -> int:
        player_groups = [{i} for i in range(N)]
        logs.sort(key=lambda x: x[0])
        for l in logs:
            for g in player_groups:
                if g.__contains__(l[1]):
                    s1 = g
                if g.__contains__(l[2]):
                    s2 = g
            if s1 == s2:
                continue
            new_s = s1 | s2
            player_groups.remove(s1)
            player_groups.remove(s2)
            player_groups.append(new_s)
            if len(player_groups) <= 1:
                return l[0]
        return -1

    def maximumMinimumPath(self, A: List[List[int]]) -> int:
        rows = len(A)
        cols = len(A[0])
        A = [[-1] * cols] + A + [[-1] * cols]
        for i in range(len(A)):
            A[i] = [-1] + A[i] + [-1]

        rows = len(A)
        cols = len(A[0])
        visit = [[False for _ in range(cols)] for _ in range(rows)]
        pos = [(-1, 0), (1, 0), (0, 1),  (0, -1)]
        # pos = [(0, 1), (1, 0), (-1, 0),  (0, -1)]

        def go(x, y, now_min, best):
            if A[x][y] <= best:
                return best
            now_min = min(now_min, A[x][y])
            visit[x][y] = True
            if x == rows - 2 and y == cols - 2:
                if now_min > best:
                    best = now_min
                visit[x][y] = False
                return best
            _pos = sorted(pos,key=lambda p:A[x + p[0]][y + p[1]],reverse=True)
            for p in _pos:
                if not visit[x + p[0]][y + p[1]] and A[x + p[0]][y + p[1]] > best:
                    best_ = go(x + p[0], y + p[1], now_min, best)
                    if best_ > best:
                        best = best_
            visit[x][y] = False
            return best

        return go(1, 1, 1e9, 0)


